import {  StyleSheet, Text, View } from 'react-native';
import {styles} from './style.js';

function Header() {

    return (
      <View>
        <View style={styles.containerBottom}>
          <Text>Headerrr</Text>
        </View>
      </View>
    )
  }
  
  export default Header
